	add("globe", "{\"term\":\"globe\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) {{m|fro|globe}}, borrowed from Latin {{m|la|globus}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any spherical (or nearly spherical) object\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"the \u0027\u0027globe\u0027\u0027 of the eye; the \u0027\u0027globe\u0027\u0027 of a lamp\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The planet Earth\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"issue\u003d6|page\u003d18|magazine\u003d|title\u003d[http://www.theguardian.com/commentisfree/2013/jul/10/geopolitics-transatlantic-trade-deal Where Dr Pangloss meets passage\u003dHidden behind thickets of acronyms and gorse bushes of detail, a new great game is under way across the \u0027\u0027globe\u0027\u0027. Some call it geoeconomics, but it\u0027s geopolitics too. The current power play consists of an extraordinary range of countries simultaneously sitting down to negotiate big free trade and investment agreements\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A spherical model of Earth or any planet\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A light bulb\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1920\u0027\u0027, Southern Pacific Company, \u0027Southern Pacific bulletin: volumes 9-10\u0027 (page 26\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Don\u0027t ask for a new \u0027\u0027globe\u0027\u0027 just because the old one needs dusting. The old-style carbon lamps wasted electricity when they began to fade and it was economy to replace them\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A circular military formation used in Ancient Rome, corresponding to the modern infantry square\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Milto\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Him round / A \u0027\u0027globe\u0027\u0027 of fiery seraphim enclosed\", \"priority\":11}]}, \"synonyms\":{}}");

