	add("globefish", "{\"term\":\"globefish\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|globe|fish|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of many marine fish in the family Tetraodontidae, especially the puffer or sunfish, that can inflate itself to form a globe\", \"priority\":1}]}, \"synonyms\":{}}");

