	add("globesity", "{\"term\":\"globesity\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|globe|obesity|lang\u003den}}. Coined by the w:World Health Organization|World Health Organization in 2001.\u0026lt;ref\u0026gt;Ton Kuntz, \u0026quot;[http://www.nytimes.com/2003/12/28/weekinreview/page-two-buzzwords-what-we-said-and-what-we-meant-a-to-z.html Buzzwords; What We Said And What We Meant, A to Z]\u0026quot;, \u0027The New York Times\u0027, 28 December 2003\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The worldwide obesity epidemic\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Claudia Kalb, \u0026quot;[http://www.thedailybeast.com/newsweek/2010/03/13/culture-of-corpulence.html Culture of Corpulence]\u0026quot;, \u0027Newsweek\u0027, 13 March 2010\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"quot;\u0027\u0027Globesity\u0027\u0027\u0026quot; has consumed much of the planet, with more than 1 billion adults overweight or obese\", \"priority\":3}]}, \"synonyms\":{}}");

	add("globish", "{\"term\":\"globish\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|global|English|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A simplified version of the English language, not created but consisting of the most common English words and phrases, enabling non-English-speakers to communicate\", \"priority\":1}]}, \"synonyms\":{}}");

