	add("glogg", "{\"term\":\"glogg\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Swedish\"], \"text\":\"From Swedish \u0027glögg\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A Scandinavian version of vin chaud or mulled wine; a hot punch made of red wine, brandy and sherry flavoured with almonds, raisins and orange peel\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027, Stella Ross Collins, \u0027Christmas!: Traditions, Celebrations and Food Across Europe\u0027, Kyle Cathie (1999), ISBN 9781856263399, [http://books.google.com/books?ei\u003dE8G1UJ6uFuSbjAKHm4HYBw\u0026amp;id\u003dbJuXC-d-wFQC\u0026amp;dq\u003d%22warm%20%22+glogg page 12\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The first celebration takes place on the first Sunday in Advent, when friends and family gather to drink warm \u0027\u0027glogg\u0027\u0027 - a kind of mulled wine\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Becky Ohlsen \u0026amp; Jonathan Smith, \u0027Stockholm\u0027, Lonely Planet (2004), ISBN 9781741041729, [http://books.google.com/books?id\u003dskJHrgPELxUC\u0026amp;pg\u003dPA11 page 11\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Adult Swedes also enjoy their favourite Christmas drink, \u0027\u0027glogg\u0027\u0027, which is a spicy mulled wine\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Katherine Shonk, \u0027Happy Now?\u0027, Farrar, Straus and Giroux (2010), ISBN 9780374281434, [http://books.google.com/books?id\u003d30_z42YbYicC\u0026amp;pg\u003dPA178 page 178\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"He led her into a pack of people drinking \u0027\u0027glogg\u0027\u0027, steam rising from the glass mugs\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Steve Zingerman, \u0027The Beautiful Mistake\u0027, iUniverse (2011), ISBN 9781462049592, [http://books.google.com/books?id\u003dKocSFt0FBQMC\u0026amp;pg\u003dPA52 page 52\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Afterwards we went over to talk to her friend Edith Conover about getting a bottle of \u0027\u0027glogg\u0027\u0027 for Christmas dinner\", \"priority\":9}]}, \"synonyms\":{}}");

	add("glomus", "{\"term\":\"glomus\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"Latin\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A fold of the mesothelium arising near the base of the mesentery in the pronephron, and containing a ball of blood vessels\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A highly organized vessel that connects an artery and a vein (bypassing capillaries) in an extremity such as a finger, toe, or ear or in another organ that is not part of the body\u0027s core. The glomus regulates the flow of blood, controlling temperature in order to conserve heat in the organ and, indirectly, controls the blood pressure and other functions of the circulatory system\", \"priority\":2}]}, \"synonyms\":{}}");

	add("gloom", "{\"term\":\"gloom\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\", \"Norwegian\"], \"text\":\"From Middle english (1100-1500) {{m|enm|*gloom}}, {{m|enm|*glom}}, from Old english (ca. 450-1100) {{m|ang|glōm||gloaming, twilight, darkness}}, from Proto-germanic {{m|gem-pro|*glōmaz||gleam, shimmer, sheen}}, from Proto-indo-european {{m|ine-pro|*gʰel-||to gleam, shimmer, glow}}. Cognate with Norwegian \u0027glom\u0027 (transparent membrane)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Darkness, dimness or obscurity\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"the \u0027\u0027gloom\u0027\u0027 of a forest, or of midnight\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1898\u0027\u0027, Chapter\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Here was a surprise, and a sad one for me, for I perceived that I had slept away a day, and that the sun was setting for another night. And yet it mattered little, for night or daytime there was no light to help me in this horrible place; and though my eyes had grown accustomed to the \u0027\u0027gloom\u0027\u0027, I could make out nothing to show me where to work\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A melancholy, depressing or despondent atmosphere\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Cloudiness or heaviness of mind; melancholy; aspect of sorrow; low spirits; dullness\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A sullen \u0027\u0027gloom\u0027\u0027 and furious disorder prevailed by fits\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A drying oven used in gunpowder manufacture\", \"priority\":8}]}, \"synonyms\":{}}");

