	add("glory", "{\"term\":\"glory\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) \u0027glory\u0027 \u0027glorie\u0027 from Old french (842-ca. 1400) \u0027glorie\u0027 (glory) from Latin {{m|la|glōria||glory, fame, renown, praise, ambition, boasting}}, from Proto-indo-european {{m|ine-pro|*glōs-}}, {{m|ine-pro|*gals-}}, {{m|ine-pro|*galos-||voice, cry}}. Cognate with Ancient greek (to 1453) \u0027κλέος\u0027 (lang\u003dgrc) Old english (ca. 450-1100) \u0027ceallian\u0027 (to cry out, shout, call) More at {{l|en|call}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Great beauty or splendour, that is so overwhelming it is considered powerful\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL1097634W The Mirror and the passage\u003dHe was thinking; but the \u0027\u0027glory\u0027\u0027 of the song, the swell from the great organ, the clustered lights, […], the height and vastness of this noble fane, its antiquity and its strength—all these things seemed to have their part as causes of the thrilling emotion that accompanied his thoughts\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/science-and-technology/21604091-it-possible-sniff-out-problems-sewer-pipes-they-happen-its-gas It\u0027s a passage\u003dOne of the hidden \u0027\u0027glories\u0027\u0027 of Victorian engineering is proper drains. Isolating a city’s effluent and shipping it away in underground sewers has probably saved more lives than any medical procedure except vaccination\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Honour, admiration, or distinction, accorded by common consent to a person or thing; high reputation; renown\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"c.1552–1599\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Spread his \u0027\u0027glory\u0027\u0027 through all countries wide\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"That quality in a person or thing which secures general praise or honour\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Sir (1554-1586\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Think it no \u0027\u0027glory\u0027\u0027 to swell in tyranny\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1564-1616\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Jewels lose their \u0027\u0027glory\u0027\u0027 if neglected\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL5535161W Mr. Pratt\u0027s passage\u003dThen he commenced to talk, really talk. and inside of two flaps of a herring\u0027s fin he had me mesmerized, like Eben Holt\u0027s boy at the town hall show. He talked about the ills of humanity, and the \u0027\u0027glories\u0027\u0027 of health and Nature and service and land knows what all\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Worship or praise\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"Bible, ii. 1\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"Glory\u0027\u0027 to God in the highest\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"Optical phenomenon caused by water droplets\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"Victory; success\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"An emanation of light supposed to proceed from beings of peculiar sanctity. It is represented in art by rays of gold, or the like, proceeding from the head or body, or by a disk, or a mere line\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"Pride; boastfulness; arrogance\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"1559-1634\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"in \u0027\u0027glory\u0027\u0027 of thy fortunes\", \"priority\":21}]}, \"synonyms\":{}}");

	add("gloria", "{\"term\":\"gloria\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"Latin \u0027gloria\u0027 (glory) first used as a name in 19th century literature.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Popular during the first half of the 20th century\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1835\u0027\u0027 \u0027Jacobus Flax\u0027, w:The The Knickerbocker, October 1835, page 291\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Miss Flax, the little thin sister, and Miss \u0027\u0027Gloria\u0027\u0027, the stout able-bodied sister, lifted up their hands and eyes in horror at the mere hint of a wet nurse\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1898\u0027\u0027 w:George Bernard George Bernard Shaw, \u0027You Never Can Tell\u0027, Act II\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Crampton\u0027. - - - What\u0027s your name? I mean your pet name. They can\u0027t very well call you Sophronia\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Gloria\u0027. Sophronia! My name is \u0027\u0027Gloria\u0027\u0027. I am always called by it\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Crampton\u0027. Your name is Sophronia, girl: you were called after your aunt Sophronia, my sister: she gave you your first Bible with your name written in it\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Gloria\u0027: Then my mother gave me a new name\", \"priority\":8}]}, \"synonyms\":{}}");

	add("glorification", "{\"term\":\"glorification\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027glorification\u0027 from Latin \u0027glorificatio\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of glorifying or the state of being glorified\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The worshiping of a deity; extolment or laudation\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The portrayal of something as being ideal; idealization\", \"priority\":3}]}, \"synonyms\":{}}");

