	add("glossolalia", "{\"term\":\"glossolalia\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{confix|glosso|lalia|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"speak in Speaking in tongues; speaking a language one does not know, or speaking elaborate but apparently meaningless speech, while in a trance-like state (or, supposedly, under the influence of spirits\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"issn \u003d 0021-8294 volume \u003d 11 issue \u003d 3 page \u003d 293 publisher \u003d Blackwell passage \u003d But \u0027\u0027glossolalia\u0027\u0027 by definition makes no such sense, because it consists of strings of syllables, made up of sounds taken from all those that the speaker knows, put together more or less haphazardly but emerging nevertheless as word-like and sentence-like units because of realistic, language-like rhythm and melody\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, ‘Text Messenger’, \u0027Literary Review\u0027 404\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Everything was a labyrinthine amalgam of languages, a towering Babel of puns and \u0027\u0027glossolalia\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Xenoglossy\", \"priority\":5}]}, \"synonyms\":{}}");

